--
-- Create procedure `Proc_Employee_UpdateById`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_Employee_UpdateById (IN employeeId char(36), IN employeeCode char(20), IN fullName varchar(255), IN gender tinyint, IN genderName varchar(255), IN dateOfBirth datetime, IN identityNumber varchar(255), IN identityPlace varchar(255), IN IdentityDate datetime, IN departmentId char(36), IN departmentName varchar(255), IN positionId char(36), IN positionName varchar(255), IN address varchar(255), IN phoneNumber varchar(255), IN landlinePhone varchar(255), IN email varchar(255), IN bankAccount varchar(255), IN bankName varchar(255), IN bankAddress varchar(255), IN modifiedBy varchar(255))
COMMENT 'Cập nhật thông tin 1 người dùng theo id
author: Trương Mạnh Quang (6/8/2023)'
BEGIN
  DECLARE depname varchar(255);
  DECLARE posName varchar(255);
  -- check tên phòng ban
  IF (departmentName IS NULL)
    OR (departmentName NOT IN (SELECT
        d.DepartmentName
      FROM department d)) THEN
    SET depName = (SELECT
        d.DepartmentName
      FROM department d
      WHERE d.DepartmentId = departmentId);
  ELSE
    SET depName = departmentName;
  END IF;
  -- check tên chức danh
  IF (positionName IS NULL)
    OR (positionName NOT IN (SELECT
        mp.PositionName
      FROM m_position mp)) THEN
    SET posName = (SELECT
        mp.PositionName
      FROM m_position mp
      WHERE mp.PositionId = positionId);
  ELSE
    SET posName = positionName;
  END IF;
  -- check tên giới tính
  IF gender = 0 THEN
    SET genderName = 'Nam';
  ELSEIF gender = 1 THEN
    SET genderName = 'Nữ';
  ELSE
    SET genderName = 'Chưa xác định';
  END IF;

  UPDATE employee e
  SET EmployeeCode = employeeCode,
      FullName = fullName,
      Gender = gender,
      GenderName = genderName,
      DateOfBirth = dateOfBirth,
      IdentityNumber = identityNumber,
      IdentityPlace = identityPlace,
      IdentityDate = IdentityDate,
      DepartmentId = departmentId,
      DepartmentName = depname,
      PositionId = positionId,
      PositionName = posName,
      Address = address,
      PhoneNumber = phoneNumber,
      LandlinePhone = landlinePhone,
      Email = email,
      BankAccount = bankAccount,
      BankName = bankName,
      BankAddress = bankAddress,
      ModifiedBy = modifiedBy,
      ModifiedDate = NOW()
  WHERE e.EmployeeId = employeeId;
END
$$

--
-- Create procedure `Proc_Employee_NextCode`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_Employee_NextCode (IN code char(20))
COMMENT 'Sinh mã nhân viên tự tăng
author: Trương Mạnh Quang (30/8/2023)'
BEGIN
  DECLARE prefix varchar(20);
  DECLARE suffix varchar(20);
  DECLARE newCode varchar(21);

  DECLARE i int DEFAULT -1;
  DECLARE lenCode int DEFAULT 0;
  DECLARE checkCharacter char(1);
  DECLARE asciiCode int;

  SET lenCode = CHAR_LENGTH(code);

  REPEAT
    SET i = i - 1;
    SET checkCharacter = SUBSTRING(code, i, 1);
    SET asciiCode = ASCII(checkCharacter);
  UNTIL asciiCode < 48 OR asciiCode > 57
  END REPEAT;

  SET prefix = SUBSTRING(code, 1, lenCode - (0 - i - 1));
  SET suffix = SUBSTRING(code, i + 1) + 1;

  IF suffix = 99999999999999999 THEN
    SET newCode = '-1';
    SELECT
      newCode;
  ELSE
    SET newCode = CONCAT(prefix, suffix);
  -- Kiểm tra sự tồn tại của mã mới và tăng mã mới cho đến khi không còn trùng lặp
  myloop:
    WHILE EXISTS (SELECT
          1
        FROM employee e
        WHERE e.EmployeeCode = newCode) DO
      IF suffix = 99999999999999999 THEN
        SET newCode = '-1';
        LEAVE myloop;
      END IF;
      SET suffix = suffix + 1;
      SET newCode = CONCAT(prefix, suffix);
    END WHILE myloop;
    SELECT
      newCode;
  END IF;
END
$$

--
-- Create procedure `Proc_Employee_NewCode`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_Employee_NewCode ()
COMMENT 'lấy mã mới
author: Trương Mạnh Quang (8/8/2023)'
BEGIN
  DECLARE MaxCode bigint;
  DECLARE NewEmployeeCode text;
  -- Tìm mã nhân viên có số lớn nhất trong db
  SELECT
    MAX(CAST(SUBSTRING(EmployeeCode, 4) AS UNSIGNED)) INTO MaxCode
  FROM employee e;

  -- Nếu không tìm thấy mã nào, gán giá trị ban đầu
  IF MaxCode IS NULL THEN
    SET MaxCode = 0;
  END IF;

  -- nếu mã đến giới hạn trả về -1
  IF MaxCode = 99999999999999999 THEN
    SET NewEmployeeCode = '-1';
    SELECT
      NewEmployeeCode;
  ELSE
    -- tăng mã lên 1
    SET NewEmployeeCode = CONCAT('NV-', MaxCode + 1);
    SELECT
      NewEmployeeCode;
  END IF;
END
$$

