--
-- Create procedure `Proc_Employee_Filter`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_Employee_Filter (IN searchKey text, IN pageNum int, IN pageSize int)
COMMENT 'phân trang danh sách nhân viên
author: Trương Mạnh Quang (7/8/2023)'
BEGIN
  DECLARE totalRecords int DEFAULT 0;
  DECLARE totalPages int DEFAULT 0;
  DECLARE currentPage int DEFAULT 0;
  DECLARE currentRecords int DEFAULT 0;
  DECLARE skipRecords int DEFAULT 0;


  SELECT
    COUNT(*) INTO totalRecords
  FROM employee e
  WHERE e.EmployeeCode LIKE CONCAT('%', searchKey, '%')
  OR e.FullName LIKE CONCAT('%', searchKey, '%')
  OR e.PhoneNumber LIKE CONCAT('%', searchKey, '%');
  -- nếu có records trả về thông tin trang và danh sách nhân viên
  IF totalRecords <> 0 THEN
    -- nếu pageSize hoặc pageNum <= 0 trả về toàn bộ dữ liệu
    IF pageNum <= 0
      OR pageSize <= 0 THEN
      SET totalPages = 1;
      SET currentPage = 1;
      SET currentRecords = totalRecords;

      SELECT
        totalRecords;
      SELECT
        totalPages;
      SELECT
        currentPage;
      SELECT
        currentRecords;

      SET @filter = CONCAT(' SELECT * FROM employee e WHERE e.EmployeeCode LIKE \'%', searchKey, '%\' OR e.FullName LIKE \'%', searchKey, '%\' OR e.PhoneNumber LIKE \'%', searchKey, '%\' ORDER BY e.CreatedDate DESC; ');
      PREPARE stmt1 FROM @filter;
      EXECUTE stmt1;
      DEALLOCATE PREPARE stmt1;
    ELSE
      SET totalPages = CEIL(totalRecords / pageSize);
      SET currentPage = IF(pageNum < 1, 1, IF(pageNum > totalPages, totalPages, pageNum));
      SET currentRecords = IF(currentPage < totalPages, pageSize, totalRecords - ((currentPage - 1) * pageSize));
      SET skipRecords = (currentPage - 1) * pageSize;

      SELECT
        totalRecords;
      SELECT
        totalPages;
      SELECT
        currentPage;
      SELECT
        currentRecords;

      SET @filter = CONCAT('SELECT * FROM employee e WHERE e.EmployeeCode LIKE \'%', searchKey, '%\' OR e.FullName LIKE \'%', searchKey, '%\' OR e.PhoneNumber LIKE \'%', searchKey, '%\' ORDER BY e.CreatedDate DESC LIMIT ', skipRecords, ', ', pageSize);
      PREPARE stmt1 FROM @filter;
      EXECUTE stmt1;
      DEALLOCATE PREPARE stmt1;
    END IF;
  -- nếu không có records thì trả về danh sách rỗng và thông tin trang là 0
  ELSE
    SELECT
      totalRecords;
    SELECT
      totalPages;
    SELECT
      currentPage;
    SELECT
      currentRecords;
    -- lấy danh sách rỗng
    SET @filter = CONCAT('SELECT * FROM employee e LIMIT 0,0');
    PREPARE stmt1 FROM @filter;
    EXECUTE stmt1;
    DEALLOCATE PREPARE stmt1;
  END IF;
END
$$

